Here's a recursive function that can solve the Towers of Hanoi problem:
```
int hanoi(int n, char start, char end, char temp) {
    if (n == 1) {
        cout << "Move disk 1 from " << start << " to " << end;
        return 0;
    }
    int result = hanoi(n - 1, start, temp, end);
    cout << "Move disk " << n << " from " << start << " to " << end;
    result += hanoi(n - 1, temp, start, end);
    return result;
}

